PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE user (_id INTEGER PRIMARY KEY AUTOINCREMENT, account TEXT UNIQUE, photo TEXT, email TEXT, token TEXT, remark TEXT);
CREATE TABLE conversations (_id INTEGER PRIMARY KEY AUTOINCREMENT, conv_id TEXT UNIQUE, sender_name TEXT, content TEXT, time TEXT, unread INTEGER, remark TEXT);
CREATE TABLE chat_messages (_id INTEGER PRIMARY KEY AUTOINCREMENT, msg_id TEXT, conv_id TEXT, sender TEXT, receiver TEXT, content TEXT, timestamp TEXT);
DELETE FROM sqlite_sequence;
COMMIT;